import React from 'react'
import { Link } from 'react-router-dom'
import logo_text from '../images/logo_teks.png'

const Navbar = () => {
    return (
        <nav className="flex justify-between items-center h-16 bg-white shadow-sm relative font-spartan px-10 lg:px-16 " role='navigation'>


            <Link to='/'>
                 <img src={logo_text} alt='logo' className='h-4 lg:h-6'/>
             </Link>

            <div className="">
                <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
                </svg>
            </div>

            <div className="cursor-pointer md:hidden ">
                 <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                     <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
                 </svg>
            </div>

            <div className="justify-between text-xs lg:text-sm md:block hidden ">
                <Link className='p-4 lg:p-6' to='/'>Home</Link>
                <Link className='p-4 lg:p-6' to='/products'>Products</Link>
                <Link className='p-4 lg:p-6' to='/about'>About Us</Link>
                <Link className='p-4 lg:p-6' to='/solutions'>Solutions</Link>
                <Link className='p-4 lg:p-6' to='/blog'>Blog</Link>
                <Link className='p-4 lg:p-6' to='/contact'>Contact Us</Link>
             </div>

        </nav>
        // <nav className='flex justify-between items-center h-20 bg-white text-black relative shadow-sm font-spartan' role='navigation'>
        //     <Link to='/'>
        //         <img src={logo_text} alt='logo' className='pl-8 h-4 lg:pl-20 h-6'/>
        //     </Link>
        //     <div className="cursor-pointer  md:hidden ">
        //         <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
        //             <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
        //         </svg>
        //     </div>

        //     <div className="">

        //     </div>

        //     <div className=" justify-between pr-40 text-sm md:block hidden ">
        //         <Link className='p-6' to='/'>Home</Link>
        //         <Link className='p-6' to='/products'>Products</Link>
        //         <Link className='p-6' to='/about'>About Us</Link>
        //         <Link className='p-6' to='/solutions'>Solutions</Link>
        //         <Link className='p-6' to='/blog'>Blog</Link>
        //         <Link className='p-6' to='/contact'>Contact Us</Link>

        //     </div>
        // </nav>
    )
}

export default Navbar
